description.text:
&quot;Bear down, Chicago Bears, put up a fight with a might so fearlessly . . . &quot;  
Bears logo. Created in Illustrator and extruded using Tinkercad. Printed out in True Orange PLA on a MakerBot Replicator 2.   
Printed using a raft. This print is quite thin and getting off the raft was a bit tricky.
